import React, { useState, useEffect } from "react";

export default function App() {
  const [image, setImage] = useState(null);
  const [result, setResult] = useState("Aucun r√©sultat de d√©tection...");
  const [nodes, setNodes] = useState([]);

  const MASTER_URL = "http://192.168.137.1:8000";

  // üîπ Rafra√Æchir l‚Äô√©tat des nodes
  useEffect(() => {
    const interval = setInterval(async () => {
      try {
        const res = await fetch(`${MASTER_URL}/nodes`);
        const data = await res.json();
        setNodes(data || []);
      } catch (err) {
        console.error("Erreur fetch nodes :", err);
      }
    }, 1000);
    return () => clearInterval(interval);
  }, []);

  // üîπ Rafra√Æchir le dernier r√©sultat YOLO
  useEffect(() => {
    const interval = setInterval(async () => {
      try {
        const res = await fetch(`${MASTER_URL}/last_result`);
        const data = await res.json();
        if (!data.message) setResult(data); // si data contient les d√©tections
      } catch (err) {
        console.error("Erreur fetch last_result :", err);
      }
    }, 1500);
    return () => clearInterval(interval);
  }, []);

const getColor = (status, isConnected) => {
    if (!isConnected) return "#60a5fa";     // bleu = non connect√©
    if (status === 1) return "#4ade80";     // vert = dispo
    if (status === 0) return "#f87171";     // rouge = occup√©
    return "#60a5fa";                       // fallback
  };

  const handleUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setImage(URL.createObjectURL(file));
    const formData = new FormData();
    formData.append("image", file);

    try {
      const res = await fetch(`${MASTER_URL}/relay`, {
        method: "POST",
        body: formData,
      });
      const data = await res.json();
      setResult(data.message || "‚úÖ Image re√ßue par master");
    } catch (err) {
      console.error(err);
      setResult("‚ùå Master ne r√©pond pas");
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.left}>
        <div style={styles.imageBox}>
          {image ? <img src={image} style={styles.image} alt="fog detect" /> : <p>Charge une image</p>}
        </div>

        <div style={styles.resultBox}>
          {typeof result === "string"
            ? result
            : result.detections?.map((det, i) => (
                <div key={i}>
                  {det.class} ({(det.confidence * 100).toFixed(1)}%) at [{det.bbox.map((n) => n.toFixed(0)).join(", ")}]
                </div>
              ))}
        </div>

        <input type="file" onChange={handleUpload} />
      </div>

      <div style={styles.right}>
        <div style={styles.header}>Nodes Status</div>
        {["FogNode1", "FogNode2", "FogNode3"].map((name) => {
          const node = nodes.find((n) => n.name === name);
          return (
            <div
              key={name}
              style={{
                ...styles.nodeStyle,
                backgroundColor: getColor(node?.available),
              }}
            >
              {name} {node?.available === 1 ? "üü¢" : node?.available === 0 ? "üî¥" : "üîµ"}
            </div>
          );
        })}
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    width: "100vw",
    height: "100vh",
    justifyContent: "center",
    alignItems: "center",
    background: "linear-gradient(135deg,#fbc2eb,#fde047)",
  },
  left: {
    display: "flex",
    flexDirection: "column",
    marginRight: "200px",
    gap: "20px",
    alignItems: "center",
  },
  right: { display: "flex", flexDirection: "column", alignItems: "center", gap: "15px" },
  header: {
    width: "220px",
    padding: "12px",
    textAlign: "center",
    fontWeight: "bold",
    fontSize: "20px",
    borderRadius: "10px",
    background: "#9f23d1",
    color: "white",
  },
  imageBox: {
    width: "420px",
    height: "320px",
    borderRadius: "15px",
    background: "#d8b4fe",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    border: "3px dashed white",
    overflow: "hidden",
  },
  image: { width: "100%", height: "100%", objectFit: "cover", borderRadius: "15px" },
  resultBox: {
    width: "420px",
    padding: "15px",
    borderRadius: "10px",
    background: "#c084fc",
    textAlign: "center",
    fontSize: "18px",
    fontWeight: "bold",
    color: "white",
    maxHeight: "220px",
    overflowY: "auto",
  },
  nodeStyle: { width: "200px", padding: "12px", borderRadius: "10px", fontWeight: "bold", color: "white", textAlign: "center", fontSize: "18px" },
};
